    state = {
        viewport: {
            width: 400,
            height: 400,
            latitude: 37.7577,
            longitude: -122.4376,
            zoom: 8
        }
    };

    render(){

        const style  = {
            position: 'absolute',
            top: 0,
            bottom: 0,
            width: '100%'
          };

        return(
            <ReactMapGL {...this.state.viewport} onViewportChange={(viewport) => this.setState({viewport})}
             mapboxApiAccessToken = 'pk.eyJ1IjoiZWRodWJiYXJkMTk5NCIsImEiOiJjamJmb3p2ZHQyeGNyMzJwZWFqeWd4ZDN6In0.yWQQD8j1AotGQkAeoQm7FA' />
        );
    }
}


export default ViewMap;
